    n = len(seq)
    from functools import lru_cache

    @lru_cache(None)
    def parse(i):
        # returns set of end positions reachable after parsing one Polish sequence starting at i
        res = set()
        if i >= n:
            return frozenset()
        v = seq[i]
        if v == 0:
            res.add(i+1)
            return frozenset(res)
        # Need to parse v sequences starting at i+1
        cur = set([i+1])
        for _ in range(v):
            nxt = set()
            for pos in cur:
                ends = parse(pos)
                for e in ends:
                    nxt.add(e)
            cur = nxt
            if not cur:
                break
        for pos in cur:
            res.add(pos)
        return frozenset(res)

    ends = parse(0)
    return len(seq) in ends


def brute(N, A):
    cnt = 0
    for seq in product(range(N), repeat=N):
        # lex compare
        if list(seq) > A:
            continue
        if is_polish(list(seq)):
            cnt += 1
    return cnt % MOD


